const name="anas jahangir";
const image="https://picsum.photos/200/300";
const image1="https://picsum.photos/250/300";
const image2="https://picsum.photos/300/300";
const link="https://www.youtube.com/watch?v=OloAP8p1k1w&list=PLwGdqUZWnOp3aROg4wypcRhZqJG3ajZWJ&index=14";
const heading = {
    textAlign: "center",
    color: "black",
    textTransform: "capitalize",
    textDecoration: "wavy",
    fontFamily: '"Times New Roman", Times, serif',
    fontWeight: "bold",
    textShadow: "0px 2px 4px rgb(200, 131, 209)",
    margin: "50px 0px ",
};


ReactDOM.render(
    <>
<h1 style={heading}>my name is {name}</h1>
<div className='images'>
<img src={image} alt="RANDOME IMAGE"/>
<img src={image1} alt="RANDOME IMAGE"/>
<a href={link} target="_blank">
<img src={image2} alt="RANDOME IMAGE"/>
</a>
</div>
</>,
    document.getElementById("root")
);
